  'disclaimer.terms': '<li>Du må være over <span class="text-red"><b>18</b></span> år gammel, glad i dyr og ha hatt et kjæledyr tidligere.<hr></li><li>All informasjon som er oppgitt, er sann og bilder som er lastet opp er lojalitetsfrie for annonsering. Du må oppgi telefonnummeret ditt, ID-en din og e-posten din for verifisering. Vi kan gjøre en kriminell bakgrunnssjekk og fjerne ethvert mistenkelig konto.<hr></li><li>PetBacker eksisterer for å gjøre det enklere å ha et kjæledyr i livet ditt. Plattformavgiftene hjelper PetBacker å operere og kontinuerlig forbedre for å møte behovene til det voksende fellesskapet vårt. Når en kjæledyrseier ansetter deg, tar du med deg hjem <b>75% - 80%</b>. Hvis kontaktopplysninger ble utvekslet på forhånd, og jobben ikke ble betalt via PetBacker, vil du være <span class="text-red">ansvarlig for en bot på <b>40%</b> av jobbens rettferdige verdi</span> eller står overfor <b>UTESTENDELSE</b> selv om jobben ble kansellert. Vi kan donere en del av boten til dyrehjem.<hr></li><li>Du godtar at du vil refundere alle mottatte eller tilbakevendende gebyrer til kunden i tilfelle vi har avgjort i kundens favør i en tvist der du ikke har levert tilfredsstillende tjenester til kjæledyret.<hr></li><li>Du er ikke ansatt i PetBacker, men bruker i fellesskapet for å tilby dyretjenester. I tilfelle av nødsituasjoner eller brudd på lokale myndigheters regler, er du enig om at du tar fullt ansvar for en slik hendelse. PetBacker vil <span class="text-red">kun</span> hjelpe til med å minimere veterinærkostnader eller krav med <a href="https://www.petbacker.com/premium-insurance-coverage" target="_blank">dyre skade forsikring</a> for <span class="text-red">betalt Jobb</span> på plattformen</li>',
